import React from "react";
import logo from "./logo.svg";
import "./App.css";
import * as firebase from "firebase";

const firebaseConfig = {
  apiKey: "AIzaSyCjU_-CQMhUyvFjJJMGjqUhk5DLwxPIiEU",
  authDomain: "taa-dashboard.firebaseapp.com",
  databaseURL: "https://taa-dashboard.firebaseio.com",
  projectId: "taa-dashboard",
  storageBucket: "taa-dashboard.appspot.com",
  messagingSenderId: "1010311755496",
  appId: "1:1010311755496:web:a5f5e1e2521801a275bb5d",
  measurementId: "G-QMGCG3XFBY"
};

// Initialize Firebase
firebase.initializeApp(firebaseConfig);

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <img src={logo} className='App-logo' alt='logo' />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className='App-link'
          href='https://reactjs.org'
          target='_blank'
          rel='noopener noreferrer'
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
